:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Margaret Ellen and MACLEAN, Christopher Haydon
  IMACLEAN, William Haydon and McBETH, Keitha Kate Florence
  IMACLEAN, Margaret Joan and ANDREWS, Frederick Robert William
  01> MACLEAN, Margaret Joan m on 19.01.1940 to ANDREWS, Frederick Robert
  William
  b 16.08.1912 d 31.10.1986
  b 16.11.1909 d 22.03.1985
  Joan b. at Hunterville and m. at Taihape. Frederick b. at Wellington. Joan and Frederick were both
  cremated and their ashes scattered over the Lady Norwood Rose Garden. They had lived in Wellington
  since 1948, for the most part at Melrose.
  Joan was educated first by a governess and then at Clifton House and finally at Nga Tawa College in
  Marton. She then trained as a Karitane nurse at Wanganui. Her interests were golf and bridge and later
  in life she became an active member of the Miramar Bridge Club.
  Fred was educated at Marlborough College and became a journalist and then editor with the Taihape Times
  before becoming a journalist with The Press in Christchurch. He joined the Territorial Army and then
  the Airforce prior to WW2. He served in the Pacific and rose to the rank of Squadron Leader after which
  he joined Civil Aviation where he became a Regional Director before retirement. He was a keen amateur
  radio operator, a life member of the New Zealand Association of Radio Transmitters and a Fellow of the
  New Zealand Institute of Electronic Engineers.
  01> ANDREWS, John Robert Haydon m on 09.11.1968 to GROVER, Pamela Jean
  b 28.10.1940
  b 30.09.1945
  John b. at Christchurch and m. at St Ninian's Church, Karori, Wellington. Pamela, d/o Kenneth Frank
  Russell Grover and Lucy Dorothy Boshier, b. at Wanganui. Address: 136 Cheviot Road, Eastbourne,
  Wellington.
  John was educated at Scots and Rongotai Colleges and Victoria University, completing a PhD in 1969.
  He has carried out research in parasitology and medical entomology at the University of Bern and
  the University of Massachusetts. An interest in New Zealand science history led to the publication
  of "The Southern Ark". He served terms as Chairman of the School of Biological Sciences and
  Academic Dean of Science, at Victoria University. Currently he is Associate Professor at the
  School of Biological Sciences.
  Pamela was educated at Palmerston North Girls' High School and Victoria University where she
  obtained degrees in Arts and Law. She has worked for the Justice Department, Consumer Organisation
  and the Ministry of Foreign Affairs before entering legal practice. She is currently a partner in
  Kensington Swan. She is a director of Ruapehu Alpine Lifts and shares an interest in skiing with
  her family.
  01> 'ANDREWS, Sarah Katherine
  b 21.10.1973
  Sarah b. at Lower Hutt. She was educated at Queen Margaret College and graduated BA and BSC
  from Victoria University. She is interested in music represented her school and region in
  national competitions in skiing and athletics. She is now working for Telecom New Zealand in
  communications.
  02> ANDREWS, Benjamin Haydon
  b 11.07.1974
  Benjamin b. at Lower Hutt. He attended Wellington College and is completing a BSc degree at
  Victoria University. He is a commercial pilot and flying instructor at the Wellington Aero
  Club and he also enjoys skiing.
  02> ANDREWS, Keitha Susan m on 11.01.1969 to PAINE, Niven Charles
  b 17.11.1943
  b 05.06.1944
  Susan b. at Wellington and m, at Nurses' Chapel, Wellington Hospital. Niven, s/o Alfred Charles
  Paine and Nyall Mary McKay, b. at Blenheim. Address: 2/20 Totara Crescent, Lower Hutt.
  Susan is a medical laboratory scientist working as a cytologist at Valley Diagnostic Laboratories,
  Lower Hutt. She was educated at Wellington East Girls' College and trained as a medical laboratory
  scientist at Wellington Hospital (1968).
  (cont...).
